init.script:
var text = ROYGBIV.getText("txt1");
var infoText = ROYGBIV.getText("info");
var gitText = ROYGBIV.getText("github");
ROYGBIV.setTextColor(text, "black");
ROYGBIV.setTextColor(infoText, "lime");
ROYGBIV.setTextAlpha(infoText, 0.6);
ROYGBIV.setTextAlpha(text, 1);
ROYGBIV.setTextBackground(text, "white", 1);
ROYGBIV.hideText(text);

ROYGBIV.setText(gitText, "GITHUB");
ROYGBIV.setTextColor(gitText, "red");
ROYGBIV.setTextAlpha(gitText, 0.6);
ROYGBIV.onTextClick(gitText, function(){
  var redirectWindow = window.open('https://github.com/oguzeroglu/ROYGBIV', '_blank');
  redirectWindow.location;
});

if (ROYGBIV.isMobile()){
  ROYGBIV.setText(infoText, "Touch to zoom, move or tap.");
}else{
  ROYGBIV.setText(infoText, "wsad - arrow keys - mouse click");
}

ROYGBIV.globals.onClick = function(x, y, z){
  ROYGBIV.showText(text);
  ROYGBIV.setTextPosition(text, x, y, z);
}

ROYGBIV.setObjectClickListener(ROYGBIV.getObject("stuff"), ROYGBIV.globals.onClick);
this.stop();
